import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

(function() {
  var firstScript = document.getElementsByTagName('script')[0]
  if (d.getElementById('applet-js-sdk')) {
    return
  }
  var sdk = document.createElement('script')
  sdk.id = 'applet-js-sdk'
  sdk.src = 'https://connect.facebook.net/en_US/fbapplet.latest.js'
  firstScript.parentNode.insertBefore(sdk, firstScript)
})

window.FBApplet.initializeAsync().then(
  () => {
    return window.FBApplet.startAppletAsync()
  }
).then(startApp)
.catch(err => {console.log(err)})

function startApp() {
  ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    document.getElementById('root')
  );
}

// If you want to start measuring performance in your app, pass a function
